import Vue from 'vue';
import Router from 'vue-router';
import homePage from './homePage.vue';
import loginPage from './loginPage.vue';
import UserComponent from './UserComponent';
Vue.use(Router);
const router = Create({
  routes: [{
    path: '/',
    component: homePage
  }, {
    path: '/login',
    component: loginPage
  }, {
    path: '/registration',
    component: UserComponent
  }]
});
export default router;
